import React from 'react';
import data from './list.json';

export const Appointment = () => {
    const appointments = data.appointments;

    return (
        <div className="container mx-auto px-4 py-8">
            <h1 className="text-2xl font-bold mb-4">Appointment List</h1>
            <div className="overflow-x-auto">
                <table className="min-w-full divide-y divide-gray-200">
                    <thead className="bg-gray-50">
                        <tr>
                            <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Patient</th>
                            <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Date</th>
                            <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Time</th>
                            <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Doctor</th>
                            <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Injury</th>
                        </tr>
                    </thead>
                    <tbody className="bg-white divide-y divide-gray-200">
                        {appointments.map(appointment => (
                            <tr key={appointment.id}>
                                <td className="px-6 py-4 whitespace-nowrap">{appointment.patient_name}</td>
                                <td className="px-6 py-4 whitespace-nowrap">{appointment.appointment_date}</td>
                                <td className="px-6 py-4 whitespace-nowrap">{appointment.appointment_time}</td>
                                <td className="px-6 py-4 whitespace-nowrap">{appointment.doctor}</td>
                                <td className="px-6 py-4 whitespace-nowrap">{appointment.injury}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}
